import React from 'react';
import { Modal, Button, Form } from 'react-bootstrap';
import ModalWrapper from '../../ModalWrapper/ModalWrapper';

interface IProps {
  show: boolean;
  handleShow: () => void;
}

const CreateTypeModal = ({ show, handleShow }: IProps) => {
  return (
    <ModalWrapper show={show} handleShow={handleShow} name="Create Device">
      {/* <Modal.Body>Create Type</Modal.Body> */}
      <Modal.Footer>
        <Form>
          <Form.Group className="mb-3" controlId="formBasicEmail">
            <Form.Label>Create Type</Form.Label>
            <Form.Control placeholder="New Type..." />
            {/* <Form.Text className="text-muted">
              We'll never share your email with anyone else.
            </Form.Text> */}
          </Form.Group>
          <Button variant="primary" type="submit">
            Submit
          </Button>
        </Form>
        <Button variant="secondary" onClick={handleShow}>
          Close
        </Button>
        {/* <Button variant="primary" onClick={handleShow}>
          Save Changes
        </Button> */}
      </Modal.Footer>
    </ModalWrapper>
  );
};

export default CreateTypeModal;
